import { Link, Switch, Route } from 'react-router-dom';
import { UserProfile } from './userProfile';

export const ResultDetails = props => {
    const {
        userId,
        username,
        resultId,
        title,
        mood
    } = props
    const location = props.username ? 'user' : 'results'
    const id = props.username ? userId : resultId

    return(
        <>
            <Link to={`/${location}/${id}`}> 
                {username  || title}
            </Link>
            { mood }
            <Switch>
                    <Route
                        path={`/user/:userId`}
                        render={() => 
                            <UserProfile
                                username={username}
                            />
                    }>
                    </Route>
                </Switch>
        </>
    )
}
